Getting Set up with Dioxus-Desktop is quite easy. Make sure you have Rust and Cargo installed, and then create a new project: $ cargo new --bin demo
$ cd app Add Dioxus with the desktop feature: $ cargo add dioxus --features desktop Edit your main.rs: // main.rs
use dioxus::prelude::*; fn main() { dioxus::desktop::launch(app);
} fn app(cx: Scope) -> Element { cx.render(rsx!{ div { "hello world!" } })
} To configure the webview, menubar, and other important desktop-specific features, checkout out some of the launch configuration in the API reference .

