To develop your Dioxus app for the web, you'll need a tool to build and serve your assets. We recommend using trunk which includes a build system, Wasm optimization, a dev server, and support for SASS/CSS. Currently, trunk projects can only build the root binary (ie the main.rs). To build a new Dioxus compatible project, this should get you up and running. First, install trunk : $ cargo install trunk Make sure the wasm32-unknown-unknown target is installed: $ rustup target add wasm32-unknown-uknown Create a new project: $ cargo new --bin demo
$ cd demo Add Dioxus with the web features: $ cargo add dioxus --features web Add an index.html for Trunk to use. Make sure your "mount point" element has an ID of "main" (this can be configured later): <html> <head> <meta content="text/html;charset=utf-8" http-equiv="Content-Type" name="viewport" content="width=device-width, initial-scale=1.0" charset="UTF-8"> </head> <body> <div id="main"> </div> </body>
</html> Edit your main.rs: // main.rs use dioxus::prelude::*; fn main() { dioxus::web::launch(app);
} fn app(cx: Scope) -> Element { cx.render(rsx!{ div { "hello, wasm!" } })
} And to serve our app: trunk serve To build our app and publish it to Github: Make sure Github Pages is set up for your repo Build your app with trunk build --release Move your generated HTML/CSS/JS/Wasm from dist into the folder configured for Github Pages Add and commit with git Push to Github That's it!
